import React,{useState} from 'react'

const Test = () => {
    const [isSvg1, setIsSvg1] = useState(true);
    const toggleSvg = () => {
    setIsSvg1((prev) => !prev);
    };
    return (
        <button className="transition-all duration-300 ease-in-out focus:outline-none" onClick={toggleSvg}>
            {isSvg1 ? (
            <svg fill="currentColor" viewBox="0 0 20 20" className="w-6 h-6 rotate-90 origin-center opacity-100">
                <path fillRule="evenodd" d="M3 5a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zM3 10a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zM9 15a1 1 0 011-1h6a1 1 0 110 2h-6a1 1 0 01-1-1z" clipRule="evenodd"></path>
            </svg>
            ) : (
            <svg
                fill="currentColor"
                viewBox="0 0 20 20"
                className="w-6 h-6 -rotate-90 origin-center opacity-0"
            >
                <path
                fillRule="evenodd"
                d="M4.293 4.293a1 1 0 011.414 0L10 8.586l4.293-4.293a1 1 0 111.414 1.414L11.414 10l4.293 4.293a1 1 0 01-1.414 1.414L10 11.414l-4.293 4.293a1 1 0 01-1.414-1.414L8.586 10 4.293 5.707a1 1 0 010-1.414z"
                clipRule="evenodd"
                ></path>
            </svg>
            )}
        </button>
    );
}

export default Test
